import React from 'react';
import aboutData from '../DataFiles/AboutData.js';

function About() {
  return (
    <div>
      <h1>About</h1>
      <h2>{aboutData.name}</h2>
      <p>{aboutData.description}</p>
      <p>{aboutData.growth}</p>
      <h3>Mission</h3>
      <p>{aboutData.mission}</p>
      <h3>Vision</h3>
      <p>{aboutData.vision}</p>
      <h3>Values</h3>
      <ul>
        <li>{aboutData.values.collaboration}</li>
        <li>{aboutData.values.innovation}</li>
        <li>{aboutData.values.inclusivity}</li>
      </ul>
    </div>
  );
}

export default About;
